import React, { useState } from "react";
import { FaFacebook, FaGoogle, FaLinkedin, FaEnvelope } from "react-icons/fa";
import axios from "axios";
import "./Signinup.css";

const Signinup = () => {
  // State to store form input values
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [message, setMessage] = useState("");

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault(); // Prevent page refresh

    // Create the user object
    const userData = { username, email, password };

    try {
      // Send a POST request to the backend API
      const response = await axios.post("http://localhost:5000/api/signup", userData);
      
      // If the response is successful, show the success message
      setMessage("Account created successfully!");
    } catch (error) {
      // Handle error if the request fails
      setMessage("Error creating account. Please try again.");
    }
  };

  return (
    <div className="signin-page">
      <nav className="navbar1">
        <div className="nav-icons1">
          <p className="webname1">
            <span className="large-text1">resume.com</span>
            <span className="small-text1">by smoother</span>
          </p>
        </div>
      </nav>

      <div className="Container1">
        <div className="centercontent">
          <h1>Sign Up</h1>
          <p>We are excited to have you join us!</p>

          {/* Sign-up Form */}
          <form onSubmit={handleSubmit} className="signinup-form">
            <div className="username-password">
              <div className="username">
                <label htmlFor="username">Username</label>
                <input
                  type="text"
                  id="username"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  required
                />
              </div>

              <div className="password">
                <label htmlFor="email">Email</label>
                <input
                  type="email"
                  id="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </div>
            </div>

            <div className="password">
              <label htmlFor="password">Password</label>
              <input
                type="password"
                id="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>

            <button type="submit">Sign Up</button>
          </form>

          {/* Display server response message */}
          {message && <p>{message}</p>}

          <div className="signinoptions">
            <button className="facebook">
              <FaFacebook className="icon" /> Facebook
            </button>
            <button className="google">
              <FaGoogle className="icon" /> Google
            </button>
            <button className="linkedin">
              <FaLinkedin className="icon" /> LinkedIn
            </button>
            <button className="email">
              <FaEnvelope className="icon" /> Email
            </button>
          </div>

          <p>
            I am already registered. <a href="/signin">Log In</a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default Signinup;
